`include "cypress.v"
/* ==================== Include Component Definitions ==================== */

module state_machine (
    input wire clock, 
    input wire Start_Btn, 
    input wire Z5_to_Z7, 
    input wire Z7_to_Z6, 
    input wire Z6_to_Z8, 
    input wire Pucks_Collected, 
    input wire Lap_Complete, 
    output wire Idle_State, 
    output wire Zone_5_State, 
    output wire Zone_7_State, 
    output wire Zone_6_State, 
    output wire Zone_8_State, 
    output wire Return_Back_State
);

/* ==================== Wire and Register Declarations ==================== */
localparam [3:0] Idle_Base = 4'b0000;
localparam [3:0] Zone_5 = 4'b0001;
localparam [3:0] Zone_8 = 4'b0100;
localparam [3:0] Return_Back = 4'b0101;
localparam [3:0] Zone_7 = 4'b0111;
localparam [3:0] Zone_6 = 4'b1000;
reg idle_st;
reg z5_st;
reg z7_st;
reg z6_st;
reg z8_st;
reg return_back_st;
reg  [3:0] StateMachine_1;

/* ==================== Assignment of Combinatorial Variables ==================== */
assign Idle_State = (idle_st);
assign Zone_5_State = (z5_st);
assign Zone_7_State = (z7_st);
assign Zone_6_State = (z6_st);
assign Zone_8_State = (z8_st);
assign Return_Back_State = (return_back_st);

/* ==================== State Machine: StateMachine_1 ==================== */
always @ (posedge clock)
begin : Idle_Base_state_logic
    case(StateMachine_1)
        Idle_Base : 
        begin
            idle_st <= (1);
            z5_st <= (0);
            z7_st <= (0);
            z6_st <= (0);
            z8_st <= (0);
            return_back_st <= (0);
            if (( Start_Btn ) == 1'b1)
            begin
                StateMachine_1 <= Zone_5 ;
            end
        end
        Zone_5 : 
        begin
            idle_st <= (0);
            z5_st <= (1);
            z7_st <= (0);
            z6_st <= (0);
            z8_st <= (0);
            return_back_st <= (0);
            if (( Z5_to_Z7 ) == 1'b1)
            begin
                StateMachine_1 <= Zone_7 ;
            end
        end
        Zone_7 : 
        begin
            idle_st <= (0);
            z5_st <= (0);
            z7_st <= (1);
            z6_st <= (0);
            z8_st <= (0);
            return_back_st <= (0);
            if (( Z7_to_Z6 ) == 1'b1)
            begin
                StateMachine_1 <= Zone_6 ;
            end
        end
        Zone_6 : 
        begin
            idle_st <= (0);
            z5_st <= (0);
            z7_st <= (0);
            z6_st <= (1);
            z8_st <= (0);
            return_back_st <= (0);
            if (( Z6_to_Z8 ) == 1'b1)
            begin
                StateMachine_1 <= Zone_8 ;
            end
        end
        Zone_8 : 
        begin
            idle_st <= (0);
            z5_st <= (0);
            z7_st <= (0);
            z6_st <= (0);
            z8_st <= (1);
            return_back_st <= (0);
            if (( Pucks_Collected ) == 1'b1)
            begin
                StateMachine_1 <= Return_Back ;
            end
        end
        Return_Back : 
        begin
            idle_st <= (0);
            z5_st <= (0);
            z7_st <= (0);
            z6_st <= (0);
            z8_st <= (0);
            return_back_st <= (1);
            if (( Lap_Complete ) == 1'b1)
            begin
                StateMachine_1 <= Idle_Base ;
            end
        end
        default :
        begin
            StateMachine_1 <= Idle_Base;
        end
    endcase
end

endmodule

